description:
Verenigde Staten
Thriller / Drama
84 minuten

een goeie film

met James Caviezel, Diora Baird en James Frain

Een groepje dieven heeft net een bankoverval gepleegd en is op de vlucht geslagen. Ze komen een stadse familie tegen. Op een 
parkeerplaats stoppen de dieven de buit in de wagen van de familie en wanneer de familie met de wagen wegrijdt, krijgen zij de 
gevaarlijke criminelen achter zich aan.
